import React from "react";

const styles = {
  heading: {
    background: "#FFFAFA",
  },
};
function Home() {
  return (
    <div style={styles.heading}>
      <h1>Welcome to my portfolio.</h1>
      <p style="text-align:center;">
        My name is Maria Ortega. Currently, I am learning at the coding boot
        camp at UNC Charlotte. My e-mail is mariaortegapb@gmail.com and my phone
        number is (336)244-2641.
      </p>
    </div>
  );
}

export default Home;
